import React from "react";
import { Link } from "react-router-dom";
import { useHistory } from "react-router-dom";

function Navbar({ loggedIn, onLogout }) {
  const history = useHistory();

  function handleLogout() {
    fetch("https://squatch-spotter-server.onrender.com/logout", {
      method: "DELETE",
    })
      .then((r) => {
        if (r.ok) {
          onLogout(); // Call the onLogout function from the parent component
          history.push("/");
        }
      })
      .catch((error) => {
        console.error("Error logging out: ", error);
      });
  }

  return (
    <nav className="bg-green-800 p-5 mt-0 fixed w-full z-10 top-0">
      <div className="container mx-auto flex flex-wrap items-center">
        <div className="flex w-full md:w-1/2 justify-center md:justify-start text-white font-extrabold items-center">
          {/* Image */}
          <img
            src="./img/squatch-spotter-logo.svg"
            alt="Squatch Spotter Logo"
            className="h-12 w-12 mr-2"
          />

          {/* Application Name */}
          <Link
            to="/"
            className="text-white no-underline hover:text-yellow-300 hover:no-underline text-2xl"
          >
            Squatch Spotter
          </Link>
        </div>

        <div className="flex w-full pt-2 content-center justify-between md:w-1/2 md:justify-end">
          <ul className="list-reset flex justify-between flex-1 md:flex-none items-center">
            {/* Remaining Navbar Links */}
            {/* ... */}
          </ul>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
